<script>
   /*-------------- Mobile view -------------------*/
   function openNav11() {
   jQuery("#mainmysidepanel").toggle();
   jQuery("sidebar-overlay", this).toggleClass("sidebar-overlay");
   jQuery("i", this).toggleClass("icon-circle-arrow-up icon-circle-arrow-down");
   jQuery('.openbtn01 i').toggleClass('fa-times fa-bars');
   
   }
   
   
   jQuery(document).ready(function () {
   
   jQuery('.sidebar-overlay').click(function() {   
   jQuery("#mainmysidepanel").toggle();
   jQuery("i", this).toggleClass("icon-circle-arrow-up icon-circle-arrow-down");
     jQuery('.openbtn01 i').toggleClass('fa-times fa-bars');
   
   
   jQuery('.shopSidebar').removeClass('slideFilter');
   
   });
   
   
    jQuery("#accordion1 li > h4").click(function () {
   
        if (jQuery(this).next().is(':visible')) {
            jQuery(this).next().slideUp(300);
            jQuery(this).children(".plusminus").text('+');
        } else {
            jQuery(this).next("#accordion1 ul").slideDown(300);
            jQuery(this).children(".plusminus").text('-');
        }
    });
   });
   
</script>


<script>
window.onscroll = function() {myFunction()};

var header = document.getElementById("myHeader");
var sticky = header.offsetTop;

function myFunction() {
  if (window.pageYOffset > sticky) {
    header.classList.add("sticky");
  } else {
    header.classList.remove("sticky");
  }
}
</script>
